import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

export default class Navigation extends React.Component<any,any> {
  constructor(props:any){
    super(props);
  }

  render(){
    return(
      <Navbar bg={this.props.bg} variant={this.props.textTheme} fixed="top">
        <Navbar.Brand onClick={()=>this.props.setSection("home")}>#10For20Challenge</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link onClick={()=>this.props.setSection("chart")}>View My Chart</Nav.Link>
            <Nav.Link onClick={()=>this.props.setSection("settings")}>Settings</Nav.Link>
          </Nav>
        </Navbar.Collapse>
            <span>Notification Icon</span>
      </Navbar>
    )
  }
}
